import React from 'react';
import styles from './Sort.module.scss';
const Sort = () => {
  return (
    <div className={styles.sort}>
      <div className={styles.sort__label}>
        <b>Сортувати по:</b>
        <span>xxx</span>
      </div>
      <div className={styles.sort__popup}>
        <ul>
          <li>xxx</li>
        </ul>
      </div>
    </div>
  );
};

export default Sort;
